function RedditLoader({saves}) {
	return <> Saved Reddits: {saves}</>;
}

RedditLoader.getInitialProps = async ({req}) => {
	const res = await fetch("");
	const json = await res.json();
	return {saves: json.reddit_saved_posts};
};

export default RedditLoader;
